import React from "react";
import styled from "styled-components";
import { FaCheckCircle, FaTrashAlt } from "react-icons/fa";

const Box = styled.div`
  width: 523.8px;
  height: 60px;
  padding: 1rem;
  border: 1px solid gray;
  border-radius: 5px;
  background-color: #fff;
  margin: 0.6rem auto;
`;

const Todo = () => {
  return (
    <Box>
      <p>New Task To do</p>
      <FaCheckCircle sty/>
      <FaTrashAlt style={{ color: "red" }} />
    </Box>
  );
};

export default Todo;
